INSERT INTO `diseases` VALUES (1,'Influenza A','A subtype of influenza virus that can cause seasonal flu epidemics and is known for its ability to mutate rapidly, making it a challenge for vaccine development.','1933-02-01'),(2,'Influenza B','Another subtype of influenza virus that primarily infects humans and causes seasonal outbreaks, typically less severe than influenza A.','1940-02-01'),(3,'HIV','The virus that causes AIDS by attacking the immune system, specifically targeting CD4 cells (T cells), which weakens the bodys ability to fight infections and diseases. It is transmitted through blood, sexual contact, and from mother to child during childbirth or breastfeeding.','1983-05-20'),(4,'COVID-19','A respiratory illness caused by the SARS-CoV-2 virus, characterized by symptoms ranging from mild cold-like effects to severe pneumonia, acute respiratory distress, and even death. It led to a global pandemic starting in 2019.','2019-12-01'),(5,'Ebola','A severe viral disease causing hemorrhagic fever, often fatal, characterized by severe bleeding, organ failure, and shock. It is transmitted through contact with bodily fluids of infected animals or humans.','1976-09-01');
