le patients.','2022-10-20 00:00:00'),(15,1,5,14,'Cluster of cases reported in a small village, with symptoms ranging from mild fever to severe respiratory distress.','2023-03-25 00:00:00'),(16,2,1,16,'Public awareness campaign initiated to educate residents on preventive measures and symptoms.','2023-07-19 00:00:00'),(17,1,2,1,'Multiple cases reported within a short timeframe. Health teams deployed for investigation.','2023-11-11 00:00:00'),(18,2,3,3,'Symptoms consistent with recent outbreaks, including fatigue, high fever, and muscle pain.','2024-04-03 00:00:00'),(19,1,4,5,'Health workers are investigating the situation after several reports of critical cases in the area.','2024-09-08 00:00:00'),(20,2,5,7,'No fatalities reported so far, but several individuals remain under observation in isolation wards.','2025-01-20 00:00:00'),(21,1,1,2,'Localized outbreak detected with symptoms of fever and persistent cough. Testing kits distributed.','2018-04-01 00:00:00'),(22,2,2,4,'Patient reported exposure to a confirmed case. Symptoms include mild fever and fatigue.','2018-08-15 00:00:00'),(23,1,3,6,'Healthcare workers confirmed cases in the area. Public health measures escalated.','2019-02-10 00:00:00'),(24,2,4,8,'Severe symptoms including high fever, vomiting, and organ failure reported in two patients.','2019-06-20 00:00:00'),(25,1,5,10,'Symptoms consistent with disease spread from recent travelers. Quarantine initiated.','2019-12-05 00:00:00'),(26,2,1,12,'Nearby community reported multiple cases with mild symptoms. Vaccination drive organized.','2020-03-12 00:00:00'),(27,1,2,14,'Monitoring suspected spread in a school environment. Symptoms include fever and fatigue.','2020-10-18 00:00:00'),(28,2,3,16,'Confirmed case in a healthcare worker. Immediate isolation and contact tracing performed.','2021-01-22 00:00:00'),(29,1,4,3,'Cluster of cases emerged after a large community event. Symptoms progressing rapidly.','2021-06-30 00:00:00'),(30,2,5,5,'Critical cases reported among elderly individuals. Support teams deployed.','2021-11-15 00:00:00'),(31,1,1,7,'Patient presenting mild respiratory symptoms. Testing to confirm diagnosis.','2022-03-10 00:00:00'),(32,2,2,9,'Multiple reports from the region indicate potential outbreak. Investigative team sent.','2022-07-14 00:00:00'),(33,1,3,11,'Health ministry alerted to sudden increase in reported cases. Awareness campaign started.','2022-12-25 00:00:00'),(34,2,4,13,'Rapid response initiated after severe cases detected. Field hospitals set up.','2023-02-18 00:00:00'),(35,1,5,15,'Symptoms in patients vary widely, from mild fever to severe dehydration.','2023-06-30 00:00:00'),(36,2,1,1,'Initial tests indicate disease presence in remote areas. Community outreach underway.','2023-10-05 00:00:00'),(37,1,2,3,'Healthcare professionals tracking spread through urban centers. Resources allocated.','2024-02-22 00:00:00'),(38,2,3,5,'No new cases reported in the past week. Situation under control.','2024-08-10 00:00:00'),(39,1,4,7,'Reported symptoms include high fever, fatigue, and severe joint pain. Medical teams active.','2024-12-01 00:00:00'),(40,2,5,9,'Localized outbreak managed effectively. No further cases expected.','2025-01-15 00:00:00');
